import { btn, btnin } from "./actionType";

function logOuttoogle() {
  return {
    type: btn,
  };
}
function logintoogle() {
  return {
    type: btnin,
  };
}
function loginData() {
  return (dispatch) => {
    console.log(Hello);
  };
}

export { loginData, logOuttoogle, logintoogle };
